import React, {Component} from 'react';
import 'bootstrap/dist/css/bootstrap.min.css';
import { Navbar, Nav, Form, FormControl, Button, NavDropdown} from 'react-bootstrap';
import './images/user_profile';

class Header extends Component {
	render(){
		var styles = {
			color: 'red'
		};

		return (
			<Navbar collapseOnSelect expand="lg" bg="light" variant="light">
				<Navbar.Brand href="#home">Stockify</Navbar.Brand>
				<Navbar.Toggle aria-controls="responsive-navbar-nav" />
				<Navbar.Collapse id="responsive-navbar-nav">
			    	<Nav className="mr-auto"/>
				    <Nav>
				    	<Nav.Link href="#deets">Stock</Nav.Link>
				    	<Nav.Link href="#deets">Porfolio</Nav.Link>
				    	<Nav.Link href="#deets">Screener</Nav.Link>
				    	<img src = {user_profile} width = '100px' height = '100px'/>
				    	<NavDropdown title="Profile" id="collasible-nav-dropdown">
					        <NavDropdown.Item href="">Action</NavDropdown.Item>
					        <NavDropdown.Item href="">Another action</NavDropdown.Item>
					        <NavDropdown.Item href="">Something</NavDropdown.Item>
					        <NavDropdown.Divider/>
					        <NavDropdown.Item href="#action/3.4">Separated link</NavDropdown.Item>
					    </NavDropdown>
				    </Nav>
				</Navbar.Collapse>
			</Navbar>

		);
	}
}

export default Header;
